import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { cacheAdapterEnhancer } from 'axios-extensions'
import swal from 'sweetalert';

class Agentes extends Component {



    constructor(){
        super();
        this.state = {
            gerentes_user : []
        }


    

        this.eliminarAgente = this.eliminarAgente.bind(this);


      
    } // FIN DE CONSTRUCTOR







    componentWillMount(){

        if(sessionStorage.getItem("email")==''){
            window.location.href = "/";
        }



        //Axios Gerentes por usuario
      axios.get("https://turnmyapp.com/ws_turnmyapp/get/turnmyapp_gerentes_user/"+sessionStorage.getItem("id")+"").then(response => {
        this.setState({
            gerentes_user: response.data
        })
      }).catch(error => {
        console.log(error);
      })
      

    }
    


    nombreRef = React.createRef();
    apellidoRef = React.createRef();
    correoRef = React.createRef();
    passwordRef = React.createRef();





    


  


    onSubmit = (e) => {
        e.preventDefault();



        const datos = {
            nombre : this.nombreRef.current.value,
            apellido : this.apellidoRef.current.value,
            correo : this.correoRef.current.value,
            password : this.passwordRef.current.value
        }
        

        
        let regex = /[\w-\.]{2,}@([\w-]{2,}\.)*([\w-]{2,}\.)[\w-]{2,4}/;

        if(datos.nombre===''){
            swal("Campo nombre vacio", "Favor de verificar", "error");
        }else if(datos.apellido===''){
            swal("Campo apellido vacio", "Favor de verificar", "error");
        }else if(datos.correo===''){
            swal("Campo correo vacio", "Favor de verificar", "error");
        }else if (regex.test(datos.correo.trim())==false) {
            swal("Campo correo invalido", "Favor de verificar", "error");
            return false;
        }else if(datos.password===''){
            swal("Campo contraseña vacio", "Favor de verificar", "error");
        }else{



         let id_sessin_agente = sessionStorage.getItem("id");
        var data_form = new FormData();
    data_form.append('nombre',datos.nombre);
    data_form.append('apellido',datos.apellido);
    data_form.append('correo',datos.correo);
    data_form.append('password',datos.password);
    data_form.append('id_sessin_agente',id_sessin_agente);


            axios({
            method: 'post',
            url: 'https://turnmyapp.com/ws_turnmyapp/get/insertar_agente_by_gerente/validacion',
            data: data_form,
            config: { headers: {'Content-Type': 'multipart/form-data' }}
            })
            .then(function (response) {

                if(response.data=='correo_invalid'){
                    swal("El correo ya se encuentra registrado", "Intenta con otro diferente", "error");
                }else{
                    swal("Agente guardado con exito", "", "success");
                }
            })
            .catch(function (response) {
                //handle error
                console.log(response);
            });

            e.currentTarget.reset();



                    setTimeout(function () {

                        const api = axios.create({
                            baseURL: 'http://turnmyapp.com/',
                            headers: {'Cache-Control': 'no-cache'},
                            adapter: cacheAdapterEnhancer(axios.defaults.adapter, true)
                        })

                            //Axios Gerentes por usuario
                            api.get("ws_turnmyapp/get/turnmyapp_gerentes_user/"+sessionStorage.getItem("id")+"").then(response => {
                                this.setState({
                                    gerentes_user: response.data
                                })
                                console.log(response.data);
                                //alert(response.data);
                            }).catch(error => {
                                console.log(error);
                            });
                          //  window.location.reload();
                
                        }.bind(this), 5000)


    


                

            }





        }





        // FUNCION ELIMINAR AGENTE
        eliminarAgente = (e) => {

            let retVal = window.confirm("¿Deseas eliminar este agente?");
               if( retVal == true ) {
                
                let id_agente_table = e;

                var data_form_delete = new FormData();
                data_form_delete.append('id_agente',id_agente_table)

                axios({
                    method: 'post',
                    url: 'https://turnmyapp.com/ws_turnmyapp/get/update_delete_agente_by_gerente/validacion',
                    data: data_form_delete,
                    config: { headers: {'Content-Type': 'multipart/form-data' }}
                    })
                    .then(function (response) {
                            swal("Agente eliminado con exito", "", "success");

                            setTimeout(function () {
                                window.location.reload();
                            }.bind(this), 2000)

                    })
                    .catch(function (response) {
                        //handle error
                        console.log(response);
                    });


                  return true;
               }
               else {

                  return false;
               }

        }





    render() {
        return (
            <div className="div_main">
        <div className="mx-auto col-sm-12">

            <br /><br />

            <div className="text-center">
                Módulo Agentes
            </div>
            
            <div className="row">
                <div className="col-md-9">
                    <div className="row">
                    <div className="col-md-12">
                                            <div className="div_after_table_dashboard">
                                            <table className="table table-dark">
                                                <thead>
                                                    <tr>
                                                    <th scope="col">Nombre</th>
                                                    <th scope="col">Apellido</th>
                                                    <th scope="col">Correo</th>
                                                    <th scope="col">Acciones</th>
                                                    </tr>
                                                </thead>
                                                <tbody>
                                                    
                                                    { this.state.gerentes_user.map((datos,i) =>
                                                    <tr>
                                                    <th  scope="row" key={i}>{datos.name}</th>
                                                    <th key={i}>{datos.lastname}</th>
                                                    <th key={i}>{datos.email}</th>
                                                    <th key={i}><button onClick={this.eliminarAgente.bind(this, datos.id)}>Eliminar</button></th>
                                                    </tr>
                                                    )}
                                                    
                                                </tbody>
                                                </table>
                                                </div>
                    

                    <br /><br />
                            <div className="card">
                                <div className="card-header">
                                    <h4 className="mb-0 title_main_formulario">INGRESE LOS SIGUIENTES DATOS</h4>
                                </div>
                                <div className="card-body">
                                    <form className="form" onSubmit={this.onSubmit} >


                                    <div className="row">
                                    <div className="col-md-12">
                                        <div className="form-group">
                                            <label className="form-control-label">Nombre</label>
                                            <div className="">
                                                <input ref={this.nombreRef} className="form-control" type="text" name="nombre" />
                                            </div>
                                        </div>
                                        <div className="form-group">
                                            <label className="form-control-label">Apellido</label>
                                            <div className="">
                                                <input ref={this.apellidoRef} className="form-control" type="text" name="apellido" />
                                            </div>
                                        </div>
                                        <div className="form-group">
                                            <label className="form-control-label">Correo</label>
                                            <div className="">
                                                <input ref={this.correoRef} className="form-control" type="text" name="correo" />
                                            </div>
                                        </div>
                                        <div className="form-group">
                                            <label className="form-control-label">Contraseña</label>
                                            <div className="">
                                                <input ref={this.passwordRef} className="form-control" type="password" name="password" />
                                            </div>
                                        </div>

                                    </div>
                                    
            


                                </div>



                                <div className="text-center">
                                        <button type="submit" className="btn btn-primary btn_form_turn"> GUARDAR </button> <br /><br />
                                </div>

                                    </form>


                                </div>
                            </div>

                    </div>
                    </div>

            </div>
            <div className="col-md-3">
                        <Link to={'/Dashboard'}><button type="button" className="btn btn-warning btn_100">Dashboard</button></Link> <br /><br />
                        <Link to={'/agentes'}><button type="button" className="btn btn-success btn_100">Agentes</button></Link> <br /><br />
                        <Link to={'/autos'}><button type="button" className="btn btn-primary btn_100">Autos</button></Link> <br/><br/>
                        <button type="button" className="btn btn-danger btn_100">Salir</button> <br/>
            </div>
            </div>



        </div>
        </div>
        );
    }
}

export default Agentes;
